import React from 'react';
import '/home/bah/Documents/Stage/DiShop/dishop/src/style/App.css';
import place from '/home/bah/Documents/Stage/DiShop/dishop/src/pages/placeholder.png';
import {Link} from 'react-router-dom';

class Accueil extends React.Component {
  render(){
    return (
      <div>
        <ul>
          <li>
            <img src={place} class="image" />
            <div class="name">
              <Link to="/Series">
              SERIES </Link>
            </div>
          </li>
          <li>
            <img src={place} class="image2"/>
            <div class="name2">
            <Link to="/Movies">
            MOVIES </Link>
            </div>
          </li>
        </ul>
      </div>
    );
  }
}

export default Accueil;
